// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CosmeticsTraceability {
    struct Product {
        string name;              // Tn sn phm
        string batchID;           // M l
        uint manufactureDate;     // Ngy sn xut (timestamp)
        string origin;            // Ngun gc
        bool isAuthentic;         // Xc thc (true nu chnh hng)
        string[] history;         // Lch s trng thi (mng string)
        address owner;            // Quyn s hu (address ETH ca owner hin ti)
    }

    mapping(uint => Product) public products; // Map ID sn phm -> chi tit
    uint public productCount = 0;             // m sn phm

    event ProductCreated(uint id, string name);
    event StatusUpdated(uint id, string newStatus);
    event OwnershipTransferred(uint id, address newOwner); // Event cho chuyn giao

    // Hm to sn phm (ch nh sn xut gi)
    function createProduct(
        string memory _name,
        string memory _batchID,
        uint _manufactureDate,
        string memory _origin
    ) public {
        productCount++;
        products[productCount] = Product(
            _name,
            _batchID,
            _manufactureDate,
            _origin,
            true,
            new string[](0), // Khi to mng rng ng c php
            msg.sender       // Owner ban u l ngi gi hm (nh sn xut)
        );
        products[productCount].history.push("Created by Manufacturer");
        emit ProductCreated(productCount, _name);
    }

    // Hm cp nht trng thi (ch owner hin ti gi c)
    function updateStatus(uint _id, string memory _newStatus) public {
        require(_id <= productCount && _id > 0, "Invalid product ID");
        require(products[_id].owner == msg.sender, "Only owner can update"); // Restrict quyn
        products[_id].history.push(_newStatus);
        emit StatusUpdated(_id, _newStatus);
    }

    // Hm chuyn giao quyn s hu (ch owner hin ti gi)
    function transferOwnership(uint _id, address _newOwner) public {
        require(_id <= productCount && _id > 0, "Invalid product ID");
        require(products[_id].owner == msg.sender, "Only current owner can transfer");
        require(_newOwner != address(0), "Invalid new owner address");
        products[_id].owner = _newOwner;
        products[_id].history.push(string(abi.encodePacked("Transferred ownership to ", toAsciiString(_newOwner))));
        emit OwnershipTransferred(_id, _newOwner);
    }

    // Hm xc thc (ngi dng qut QR, tr v thm owner)
    function verifyProduct(uint _id)
        public
        view
        returns (
            string memory name,
            string memory batchID,
            uint manufactureDate,
            string memory origin,
            bool isAuthentic,
            string[] memory history,
            address owner  // Tr v owner
        )
    {
        require(_id <= productCount && _id > 0, "Invalid product ID");
        Product memory p = products[_id];
        return (
            p.name,
            p.batchID,
            p.manufactureDate,
            p.origin,
            p.isAuthentic,
            p.history,
            p.owner  // Mi
        );
    }

    // Helper  convert address thnh string ( sa type conversion)
    function toAsciiString(address x) internal pure returns (string memory) {
        bytes memory s = new bytes(40);
        for (uint i = 0; i < 20; i++) {
            bytes1 b = bytes1(uint8(uint(uint160(x)) / (2**(8*(19 - i)))));
            bytes1 hi = bytes1(uint8(b) / 16);
            bytes1 lo = bytes1(uint8(b) - 16 * uint8(hi));
            s[2*i] = char(hi);
            s[2*i+1] = char(lo);
        }
        return string(s);
    }

    function char(bytes1 b) internal pure returns (bytes1 c) {
        if (uint8(b) < 10) return bytes1(uint8(b) + 0x30);
        else return bytes1(uint8(b) + 0x57);
    }
}
